import React from 'react';
import styles from '../../stylesheets/WaiterView/WaiterMainView.module.css';

function TableHeader () {
    return(
    <thead>
    <tr id={styles['tr_header_table']}>
    <th className={styles['th_item']}></th>
    <th className={styles['th_quantity']}>Cantidad</th>
    <th className={styles['th_price']}>Precio</th>
    <th className="num"></th>
    </tr>
    </thead>
    )
};
export default TableHeader;
